import React from "react";

const ClusterAnalysis = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Cluster Analysis</h2>
      <p>This page will display K-Means clustering results and visualizations.</p>
    </div>
  );
};

export default ClusterAnalysis;
